import React from "react";
import Wrapper from "./WorkroomPage.style.js";
import colors from "../../components/colors";
import writing from "../../assets/imgs/writing.gif";
import TitleGraphic from "../../components/TitleGraphic"
import NavBar from "../NavBar/NavBar";

const WorkroomPage = () => {
  document.body.style = `background:${colors.purple}`;

  return (
    <> <NavBar pageName="workroom" />
      <Wrapper>

        <div className="container">

          <div className="title">
            <TitleGraphic className="graphic" color={colors.apricot} />
            <h2>The Work Room</h2>
          </div>

          <br></br> <br></br> <br></br>
          <div className="row">
            <img src={writing}></img>
            <div className="box">
              <div className="inner">
                All work and no play makes Jack a dull boy.<br></br>
                All work and no play makes Jack a dull boy.<br></br>
                All work and no play makes Jack a dull boy.<br></br>
                All work and no play makes Jack a dull boy.<br></br>
                All work and no play makes Jack a dull boy.<br></br>
                All work and no play makes Jack a dull boy.<br></br>
                All work and no play makes Jack a dull boy.<br></br>
                All work and no play makes Jack a dull boy.<br></br>
                All work and no play makes Jack a dull boy.<br></br>
                All work and no play makes Jack a dull boy.<br></br>
                All work and no play makes Jack a dull boy.<br></br>
                All work and no play makes Jack a dull boy.<br></br>
                All work and no play makes Jack a dull boy.<br></br>
                All work and no play makes Jack a dull boy.<br></br>
              </div>
            </div>
          </div>
        </div>
      </Wrapper></>

  );
};

export default WorkroomPage;
